source:
/* Giscus Tokyo Night theme to match gu-log */
main {
  --color-canvas-default: #1a1b26;
  --color-canvas-subtle: #24283b;
  --color-canvas-inset: #24283b;
  --color-border-default: #3b4261;
  --color-border-muted: #3b4261;
  --color-neutral-muted: rgba(169, 177, 214, 0.15);
  --color-accent-fg: #7aa2f7;
  --color-accent-emphasis: #7aa2f7;
  --color-accent-muted: rgba(122, 162, 247, 0.3);
  --color-accent-subtle: rgba(122, 162, 247, 0.1);
  --color-btn-bg: #24283b;
  --color-btn-border: #3b4261;
  --color-btn-hover-bg: #2f3549;
  --color-btn-hover-border: #3b4261;
  --color-btn-active-bg: #3b4261;
  --color-btn-primary-bg: #7aa2f7;
  --color-btn-primary-border: #7aa2f7;
  --color-btn-primary-hover-bg: #6690e0;
  --color-btn-primary-hover-border: #6690e0;
  --color-fg-default: #a9b1d6;
  --color-fg-muted: #565f89;
  --color-fg-subtle: #565f89;
  --color-header-bg: #24283b;
  --color-header-border: #3b4261;
  --color-header-logo: #a9b1d6;
  --color-timeline-badge-bg: #24283b;
}
